async function fetchStories(){try{const t=await fetch("https://api.nytimes.com/svc/topstories/v2/science.json?api-key=cuqn1CNAXPPInZkmed1SYAtOGFewjKgB");return await t.json()}catch(t){console.error(t)}}!async function(){let t=await fetchStories();if(!t)return;$(".ajax-loader").hide();t.results.filter((function(t){if(console.log("we're in filter"),t.multimedia.length<=0)return;const e=t.multimedia.filter(t=>"Normal"===t.format);if(console.log(e[0].url),!e)return;const i=`<div class="grid-item">\n      <h1>'${t.title}'</h1>\n      <img src='${e[0].url}'/>\n    </div>`;$(".story-grid").append(i)}))}();